INSERT INTO public.foods VALUES (6, 'banana', 'fruit', 'SAFE', 'Small pieces okay; high sugar—use as occasional treat.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (7, 'blueberry', 'fruit', 'SAFE', 'Small handful okay; rich in fiber—introduce slowly.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (8, 'strawberry', 'fruit', 'SAFE', 'Small amounts okay; cut into pieces; high natural sugars.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (9, 'raspberry', 'fruit', 'CAUTION', 'Small amounts only; naturally contain trace xylitol; monitor for GI upset.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (10, 'watermelon (seedless, no rind)', 'fruit', 'SAFE', 'Seedless only and remove rind.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (11, 'cantaloupe (no rind)', 'fruit', 'SAFE', 'No rind; small amounts due to sugar.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (12, 'mango (peeled, pitted)', 'fruit', 'SAFE', 'Peel and remove pit; serve small pieces.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (13, 'pineapple (cored)', 'fruit', 'SAFE', 'Core and serve small amounts; high in sugar/fiber.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (14, 'pear (no seeds/core)', 'fruit', 'SAFE', 'Remove seeds/core; small amounts due to fiber/sugar.', '{akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (15, 'cranberry', 'fruit', 'SAFE', 'Tart; small amounts only; avoid sweetened juices/dried with sugar.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (16, 'orange segments', 'fruit', 'CAUTION', 'Acidic; small segments only; many dogs dislike citrus.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (17, 'peach (no pit)', 'fruit', 'CAUTION', 'No pit (cyanogenic); small amounts only due to sugar/fiber.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (18, 'nectarine (no pit)', 'fruit', 'CAUTION', 'No pit; small portions.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (19, 'plum (no pit)', 'fruit', 'CAUTION', 'No pit; flesh in small amounts only.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (20, 'cherry (no pit/stem)', 'fruit', 'CAUTION', 'No pits/stems (cyanogenic); small amounts; many dogs dislike.', '{aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (21, 'avocado (ripe flesh only)', 'fruit', 'CAUTION', 'Avoid pit/skin/plant; small amounts of ripe flesh may be tolerated but best avoided in many guides.', '{akc.org,aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (22, 'pomegranate', 'fruit', 'CAUTION', 'Seeds may cause GI upset; small amounts only; many dogs don’t tolerate well.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (23, 'fig', 'fruit', 'CAUTION', 'May cause GI upset; small amounts only; avoid leaves/plant.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (24, 'kiwi (peeled)', 'fruit', 'SAFE', 'Peel; slice; small amounts due to fiber/acidity.', '{akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (25, 'grapefruit', 'fruit', 'CAUTION', 'Citrus oils/acidity can cause GI upset; avoid rind/pith; many guides advise avoiding.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (26, 'tangerine', 'fruit', 'CAUTION', 'Citrus; small amounts only; avoid peel/pith; many dogs dislike.', '{akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (27, 'cucumber', 'vegetable', 'SAFE', 'Low-calorie treat; slice; avoid seasoning.', '{akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (28, 'zucchini', 'vegetable', 'SAFE', 'Small amounts; plain.', '{akc.org,aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (29, 'green beans', 'vegetable', 'SAFE', 'Plain fresh/frozen/cooked; avoid salt and seasoning.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (30, 'pumpkin (plain)', 'vegetable', 'SAFE', 'Plain cooked/canned pumpkin (not pie mix); useful for GI in moderation.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (31, 'sweet potato (plain cooked)', 'vegetable', 'SAFE', 'Cooked plain; small amounts; high fiber—introduce slowly.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (32, 'potato (plain cooked, no green parts)', 'vegetable', 'CAUTION', 'Cooked plain only; avoid green/raw (solanine).', '{merckvetmanual.com,petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (33, 'spinach', 'vegetable', 'CAUTION', 'Oxalates; small amounts only; not for dogs with kidney issues.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (34, 'kale', 'vegetable', 'CAUTION', 'Goitrogens; small amounts only; avoid for dogs with thyroid issues.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (35, 'broccoli (florets only)', 'vegetable', 'CAUTION', 'Small amounts; may cause gas; avoid large stems/choking hazard.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (36, 'cauliflower', 'vegetable', 'CAUTION', 'Small amounts; may cause gas.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (37, 'celery', 'vegetable', 'SAFE', 'Small sticks; low-calorie; watch stringy fibers.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (38, 'asparagus (cooked)', 'vegetable', 'CAUTION', 'Cooked pieces only; fibrous/raw is hard to digest; many guides advise avoiding.', '{akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (39, 'beets (cooked)', 'vegetable', 'CAUTION', 'Cooked; can stain; may cause GI upset in some dogs.', '{akc.org,aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (40, 'bell pepper (no seeds/stem)', 'vegetable', 'SAFE', 'Red/yellow/green ok in small amounts; remove seeds/stem.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (41, 'jalapeño/hot peppers', 'vegetable', 'UNSAFE', 'Spicy foods can cause GI upset; capsaicin irritation—avoid.', '{petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (42, 'mushrooms (store-bought only)', 'vegetable', 'CAUTION', 'Only store-bought culinary mushrooms in small amounts; wild mushrooms can be highly toxic.', '{aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (43, 'garlic chives/leeks/scallions', 'vegetable', 'UNSAFE', 'Allium family—risk of hemolytic anemia; avoid in all forms.', '{merckvetmanual.com,aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (44, 'lima beans (cooked, plain)', 'legume', 'SAFE', 'Cooked plain; small amounts only.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (45, 'peas (plain, cooked/frozen)', 'legume', 'SAFE', 'Plain; avoid canned with salt; watch for pea protein allergies.', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (46, 'edamame (plain, shelled)', 'legume', 'CAUTION', 'Soy—introduce slowly; some dogs may be intolerant; avoid seasonings.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (47, 'lentils (cooked, plain)', 'legume', 'SAFE', 'Cooked; small amounts; watch for gas.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (48, 'chickpeas/garbanzo (plain cooked)', 'legume', 'CAUTION', 'Cooked plain; can cause gas; avoid hummus/seasoning.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (49, 'tofu (plain)', 'legume', 'CAUTION', 'Soy product; small amounts only; check for soy allergies.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (50, 'oats (plain cooked oatmeal)', 'grain', 'SAFE', 'Plain cooked; no sugar/salt; good fiber source in moderation.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (51, 'quinoa (plain cooked)', 'grain', 'SAFE', 'Rinse and cook; small amounts; complete protein.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (52, 'barley (plain cooked)', 'grain', 'SAFE', 'Cooked plain; fiber source; introduce slowly.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (53, 'whole wheat pasta (plain cooked)', 'grain', 'CAUTION', 'Plain, small amounts; gluten sensitivity possible; avoid sauces.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (54, 'bread (plain, no raisins/xylitol)', 'grain', 'CAUTION', 'Small amounts plain; avoid raisins/xylitol; not nutritionally necessary.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (55, 'corn (plain, off cob)', 'grain', 'CAUTION', 'Plain kernels ok; avoid corn cobs (choking/obstruction risk).', '{akc.org,merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (56, 'popcorn (plain, air-popped)', 'grain', 'CAUTION', 'Plain only; no butter/salt; risk of hulls/lodging.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (57, 'peanut butter (xylitol-free)', 'spread', 'CAUTION', 'Ensure **xylitol-free**; small amounts due to fat/calories.', '{petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (58, 'almonds', 'nut', 'CAUTION', 'High fat; choking risk; many guides recommend avoiding.', '{aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (59, 'cashews (plain, unsalted)', 'nut', 'CAUTION', 'Small amounts only; high fat; avoid salted/seasoned.', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (60, 'peanuts (plain, unsalted)', 'nut', 'CAUTION', 'Many dogs tolerate small amounts; ensure no xylitol; high fat.', '{akc.org,merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (61, 'pistachios', 'nut', 'CAUTION', 'High fat; salted often; shell hazard; many guides: avoid.', '{aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (62, 'walnuts', 'nut', 'CAUTION', 'Some types/mold risk; GI upset; better to avoid.', '{petpoisonhelpline.com,aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (63, 'pecans', 'nut', 'CAUTION', 'Mold/toxin risk (tremorgenic mycotoxins) when spoiled; high fat.', '{petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (64, 'hazelnuts', 'nut', 'CAUTION', 'High fat; choking hazard; small amounts at most; many advise avoiding.', '{aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (65, 'brazil nuts', 'nut', 'CAUTION', 'Very high fat; avoid or tiny amounts only.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (66, 'sunflower seeds (unsalted, shelled)', 'seed', 'CAUTION', 'Small amounts; remove shells; avoid salt/seasoning.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (67, 'pumpkin seeds (plain, shelled)', 'seed', 'CAUTION', 'Plain, shelled; small amounts; avoid salt/seasoning.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (68, 'chia seeds (soaked)', 'seed', 'CAUTION', 'Soak; small amounts for fiber/omega-3; can cause GI upset if dry.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (69, 'flaxseed (ground)', 'seed', 'CAUTION', 'Ground; small amounts; omega-3; can affect stool; avoid whole seeds.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (70, 'plain yogurt (no xylitol)', 'dairy', 'CAUTION', 'Small amounts; lactose sensitivity possible; ensure no xylitol/sweeteners.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (71, 'cottage cheese (low-fat)', 'dairy', 'CAUTION', 'Small amounts; lactose/fat can cause GI upset; choose low-fat, plain.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (72, 'milk (plain, small amounts)', 'dairy', 'CAUTION', 'Many dogs are lactose-intolerant; small amounts only if tolerated.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (73, 'goat milk (plain)', 'dairy', 'CAUTION', 'Small amounts; still lactose; monitor tolerance.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (74, 'ice cream (plain, no xylitol)', 'dessert', 'CAUTION', 'Not recommended; lactose/sugar/fat; if ever, a tiny plain lick; ensure no xylitol.', '{akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (75, 'whipped cream (plain)', 'dessert', 'CAUTION', 'Lactose/fat; tiny amounts only; not necessary nutritionally.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (76, 'butter', 'dairy', 'CAUTION', 'Very high fat; can cause pancreatitis; avoid.', '{merckvetmanual.com,akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (77, 'cream cheese (plain)', 'dairy', 'CAUTION', 'High fat; lactose; small amounts only if at all.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (78, 'olive oil (tiny amounts)', 'oil', 'CAUTION', 'High fat; a few drops may be okay; too much causes GI upset.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (79, 'coconut oil (tiny amounts)', 'oil', 'CAUTION', 'High fat; some dogs sensitive; tiny amounts only if at all.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (80, 'honey', 'sweetener', 'CAUTION', 'Sugar; tiny amounts only; avoid for diabetic/overweight dogs.', '{akc.org,merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (81, 'maple syrup', 'sweetener', 'CAUTION', 'Sugar; tiny amounts only; not recommended.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (82, 'molasses', 'sweetener', 'CAUTION', 'Sugar; tiny amounts only; sticky/choking risk.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (83, 'stevia (pure, tiny amounts)', 'sweetener', 'CAUTION', 'Non-nutritive sweetener; tiny amounts; avoid sweetened products with xylitol.', '{merckvetmanual.com,petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (84, 'erythritol', 'sweetener', 'CAUTION', 'Not xylitol; small amounts likely tolerated; avoid sweetened processed foods.', '{petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (85, 'tea (caffeinated)', 'beverage', 'UNSAFE', 'Caffeine toxicity risk; avoid all caffeinated tea.', '{merckvetmanual.com,petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (86, 'decaf tea (plain)', 'beverage', 'CAUTION', 'Small amounts likely okay; avoid additives; still not necessary.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (87, 'coffee (caffeinated/grounds/beans)', 'beverage', 'UNSAFE', 'Caffeine; grounds/beans dangerous; avoid entirely.', '{petpoisonhelpline.com,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (88, 'energy drinks', 'beverage', 'UNSAFE', 'Caffeine/other stimulants; never.', '{petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (89, 'alcohol (all types)', 'beverage', 'UNSAFE', 'Ethanol toxicity; never.', '{merckvetmanual.com,petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (90, 'raw yeast dough', 'other', 'UNSAFE', 'Expansion and ethanol production in stomach; life-threatening.', '{merckvetmanual.com,petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (91, 'nutmeg', 'spice', 'UNSAFE', 'Myristicin toxicity; never.', '{merckvetmanual.com,aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (92, 'cinnamon (tiny amounts)', 'spice', 'CAUTION', 'Tiny amounts only; large amounts irritate mouth/GI.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (93, 'turmeric (tiny amounts)', 'spice', 'CAUTION', 'Tiny culinary amounts may be okay; supplements require vet guidance.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (94, 'ginger (tiny amounts)', 'spice', 'CAUTION', 'Small culinary amounts; avoid strong/large doses.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (95, 'clove/allspice', 'spice', 'UNSAFE', 'Eugenol toxicity risk in quantity; avoid.', '{merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (96, 'salt (table salt)', 'seasoning', 'CAUTION', 'Excess salt can cause sodium ion poisoning; avoid salty snacks.', '{merckvetmanual.com,petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (97, 'black pepper', 'seasoning', 'CAUTION', 'Irritant; tiny sprinkles only if at all; not recommended.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (98, 'onion powder (seasoning)', 'seasoning', 'UNSAFE', 'Allium—concentrated; risk of hemolytic anemia.', '{merckvetmanual.com,aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (99, 'garlic powder (seasoning)', 'seasoning', 'UNSAFE', 'Allium—avoid in all forms.', '{merckvetmanual.com,aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (100, 'cooked turkey (plain, no skin/bones)', 'protein', 'SAFE', 'Plain cooked; remove skin/bones; avoid seasoning.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (101, 'lean beef (plain cooked)', 'protein', 'SAFE', 'Plain cooked; trim fat; small portions.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (102, 'pork (plain cooked, lean)', 'protein', 'CAUTION', 'Lean cooked pork in small portions; avoid seasoned/processed (ham, bacon).', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (103, 'lamb (plain cooked)', 'protein', 'CAUTION', 'Cooked plain; moderate fat; small amounts.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (104, 'salmon (cooked, no bones)', 'protein', 'SAFE', 'Cooked; remove bones/skin; avoid smoked/seasoned; no raw due to parasites.', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (105, 'tuna (plain, cooked, no oil)', 'protein', 'CAUTION', 'Fish mercury content; small amounts only; avoid oil/salt.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (106, 'sardines (plain, in water)', 'protein', 'CAUTION', 'Small fish; omega-3; choose no-salt added; small portions.', '{merckvetmanual.com,akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (107, 'whitefish/cod (cooked, plain)', 'protein', 'SAFE', 'Lean fish cooked plain; remove bones; small amounts.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (108, 'shrimp (cooked, plain)', 'protein', 'CAUTION', 'Cooked, shelled/deveined; small portions; avoid seasoning/butter.', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (109, 'egg (cooked, plain)', 'protein', 'SAFE', 'Cooked egg; avoid raw; small amounts.', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (110, 'raw egg', 'protein', 'UNSAFE', 'Risk of Salmonella/biotin deficiency; avoid.', '{merckvetmanual.com,akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (111, 'liver (cooked, small amounts)', 'organ meat', 'CAUTION', 'Vitamin A rich; small amounts only.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (112, 'giblets/organ meats (cooked, plain)', 'organ meat', 'CAUTION', 'Cooked plain; small amounts; rich; avoid seasoning.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (113, 'bone broth (plain, no onion/garlic)', 'other', 'CAUTION', 'Plain, defatted; **no onion/garlic**; small amounts.', '{merckvetmanual.com,akc.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (114, 'cooked bones', 'other', 'UNSAFE', 'Splintering/choking/obstruction risk; never feed cooked bones.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (115, 'raw bones (supervised, appropriate size)', 'other', 'CAUTION', 'Choking/dental fracture risk; only with vet guidance and supervision.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (116, 'rice (plain cooked)', 'grain', 'SAFE', 'Plain cooked; gentle on GI in moderation.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (117, 'brown rice (plain cooked)', 'grain', 'SAFE', 'Plain cooked; more fiber; introduce slowly.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (118, 'white rice (plain cooked)', 'grain', 'SAFE', 'Plain cooked; commonly used for bland diet with vet advice.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (119, 'pasta (plain cooked)', 'grain', 'CAUTION', 'Plain; small amounts; avoid sauces/seasonings.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (120, 'bread dough (raw)', 'other', 'UNSAFE', 'Yeast expansion & ethanol production; medical emergency.', '{petpoisonhelpline.com,merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (121, 'raisins in baked goods', 'dessert', 'UNSAFE', 'Raisins are toxic; avoid all forms/products containing raisins.', '{aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (122, 'grape jelly/juice', 'dessert', 'UNSAFE', 'Derived from grapes; avoid.', '{petpoisonhelpline.com,aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (123, 'cocoa powder/baking chocolate', 'dessert', 'UNSAFE', 'Highly concentrated theobromine/caffeine; most dangerous forms.', '{merckvetmanual.com,petpoisonhelpline.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (124, 'milk chocolate candy', 'dessert', 'UNSAFE', 'Chocolate is toxic; milk chocolate still unsafe.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (125, 'dark chocolate/bar', 'dessert', 'UNSAFE', 'Higher theobromine; more dangerous than milk chocolate.', '{merckvetmanual.com,petpoisonhelpline.com,aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (126, 'xylitol (sweetener)', 'sweetener', 'UNSAFE', 'Powerful insulin release in dogs; causes hypoglycemia/liver failure.', '{petpoisonhelpline.com,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (127, 'sorbitol/maltitol (sugar alcohols)', 'sweetener', 'CAUTION', 'Can cause diarrhea/ GI upset; avoid in large amounts and processed foods.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (128, 'gravy/seasoned sauces', 'seasoning', 'CAUTION', 'Often contain onion/garlic/salt/fat; avoid.', '{akc.org,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (129, 'ketchup/mustard/mayo', 'seasoning', 'CAUTION', 'Sugar/salt/spices; avoid feeding condiments.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (130, 'peppers—black/red flakes', 'seasoning', 'CAUTION', 'Irritants; not recommended.', '{merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (131, 'deli meats (processed)', 'protein', 'CAUTION', 'High salt/fat; preservatives; avoid or tiny amounts only.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (132, 'ham/bacon/sausage', 'protein', 'CAUTION', 'High salt/fat/seasonings; many guides advise avoiding.', '{merckvetmanual.com,petpoisonhelpline.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (133, 'jerky (plain, no seasoning)', 'protein', 'CAUTION', 'Plain only; watch for salt/seasoning and quality; recalls happen.', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (134, 'cheese (plain, small amounts)', 'dairy', 'CAUTION', 'Lactose/fat; small amounts; avoid blue/soft-ripened molds.', '{akc.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (135, 'blue cheese/roquefort', 'dairy', 'UNSAFE', 'Roquefortine C; tremorgenic mycotoxin risk—avoid.', '{petpoisonhelpline.com,merckvetmanual.com,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (136, 'goat cheese (plain)', 'dairy', 'CAUTION', 'Lactose/fat; small amounts only if tolerated.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (137, 'peanut (whole, shelled)', 'nut', 'CAUTION', 'Choking risk; high fat; safer as peanut butter (xylitol-free).', '{akc.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (138, 'sesame seeds', 'seed', 'CAUTION', 'Tiny amounts ok; can appear in breads/crackers; watch fats.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (139, 'tahini (sesame paste)', 'seed', 'CAUTION', 'High fat; tiny amounts only; avoid garlic/lemon additives.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (140, 'broth powders/bouillon', 'seasoning', 'CAUTION', 'Often high sodium; may contain onion/garlic; avoid.', '{merckvetmanual.com,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (141, 'soy sauce', 'seasoning', 'CAUTION', 'High sodium; avoid.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (142, 'vinegar (tiny amounts, diluted)', 'seasoning', 'CAUTION', 'Acidic; small amounts only, diluted; not necessary.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (143, 'tomato (ripe, red flesh only)', 'vegetable', 'CAUTION', 'Avoid green parts (solanine); ripe flesh small amounts okay.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (144, 'eggplant (cooked, small amounts)', 'vegetable', 'CAUTION', 'Nightshade; can cause GI upset; cooked small portions.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (145, 'okra (cooked, plain)', 'vegetable', 'CAUTION', 'Mucilaginous; small amounts; watch GI response.', '{merckvetmanual.com,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (146, 'seaweed (plain nori)', 'other', 'CAUTION', 'Iodine content varies; tiny amounts only; avoid salted/seasoned snacks.', '{merckvetmanual.com,aspca.org,akc.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (147, 'raisins/trail mix products', 'dessert', 'UNSAFE', 'Any product containing raisins is unsafe.', '{petpoisonhelpline.com,aspca.org,merckvetmanual.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (148, 'grape leaves/vines', 'other', 'UNSAFE', 'Grapes and related plant parts unsafe; avoid.', '{aspca.org,petpoisonhelpline.com}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (149, 'poppy seeds', 'seed', 'CAUTION', 'Can cause false positives on drug tests; not needed for dogs; tiny amounts only.', '{merckvetmanual.com,akc.org,aspca.org}', '2025-11-07 18:11:25.412983-05', '2025-11-07 18:11:25.412983-05');
INSERT INTO public.foods VALUES (1, 'grape', 'fruit', 'UNSAFE', 'Toxic to dogs; can cause acute kidney injury. Avoid all forms (grapes, raisins/sultanas/currants), fresh or dried, seeded or seedless; even small amounts may be dangerous.', '{akc.org,aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 17:10:50.319165-05', '2025-11-07 19:26:10.403427-05');
INSERT INTO public.foods VALUES (2, 'raisin', 'fruit', 'UNSAFE', 'Same risk as grapes (toxic); dried form is more concentrated. Keep away from trail mix, breads, cookies, and cereals that contain raisins.', '{akc.org,aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 17:10:50.319165-05', '2025-11-07 19:26:10.403427-05');
INSERT INTO public.foods VALUES (3, 'chocolate', 'sweets', 'UNSAFE', 'Contains theobromine and caffeine (methylxanthines). Dark/baking chocolate and cocoa powder are highest risk; signs include vomiting, agitation, tachycardia, seizures. Never safe.', '{akc.org,aspca.org,petpoisonhelpline.com,merckvetmanual.com}', '2025-11-07 17:10:50.319165-05', '2025-11-07 19:26:10.403427-05');
INSERT INTO public.foods VALUES (4, 'apple', 'fruit', 'CAUTION', 'Flesh is generally safe in small pieces. Remove core, seeds, and stem (cyanogenic glycosides). No added sugar or seasoning; avoid choking hazards.', '{akc.org,aspca.org,merckvetmanual.com}', '2025-11-07 17:10:50.319165-05', '2025-11-07 19:26:10.403427-05');
INSERT INTO public.foods VALUES (5, 'chicken', 'protein', 'SAFE', 'Plain cooked chicken (boiled/baked) without skin, bones, or seasoning is safe. Avoid cooked bones (splinter risk) and onions/garlic, heavy oils, or sauces.', '{akc.org,aspca.org,merckvetmanual.com}', '2025-11-07 17:10:50.319165-05', '2025-11-07 19:26:10.403427-05');
INSERT INTO public.rules VALUES (1, 4, '{"part": "seeds"}', 'UNSAFE', 'Apple seeds contain cyanide', '2025-11-07 17:11:20.58048-05', '2025-11-07 17:11:20.58048-05');
INSERT INTO public.rules VALUES (3, 4, '{"part": "core"}', 'CAUTION', 'Core is hard and contains seeds; remove before feeding', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (4, 17, '{"part": "pit"}', 'UNSAFE', 'Stone fruit pits: choking hazard; cyanogenic compounds', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (5, 18, '{"part": "pit"}', 'UNSAFE', 'Stone fruit pits: choking hazard; cyanogenic compounds', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (6, 19, '{"part": "pit"}', 'UNSAFE', 'Stone fruit pits: choking hazard; cyanogenic compounds', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (7, 20, '{"part": "pit"}', 'UNSAFE', 'Stone fruit pits: choking hazard; cyanogenic compounds', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (8, 14, '{"part": "seeds"}', 'CAUTION', 'Seeds and core should be removed', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (9, 14, '{"part": "core"}', 'CAUTION', 'Remove core to reduce choking risk', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (10, 10, '{"part": "rind"}', 'CAUTION', 'Rind is tough and can cause GI upset; remove', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (11, 11, '{"part": "rind"}', 'CAUTION', 'Rind is tough and can cause GI upset; remove', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (12, 10, '{"part": "seeds"}', 'CAUTION', 'Remove seeds to prevent GI upset', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (13, 11, '{"part": "seeds"}', 'CAUTION', 'Remove seeds to prevent GI upset', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (14, 30, '{"part": "seeds"}', 'CAUTION', 'Remove seeds to prevent GI upset', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (15, 12, '{"part": "pit"}', 'UNSAFE', 'Remove mango pit (choking/obstruction risk)', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (16, 12, '{"part": "skin"}', 'CAUTION', 'Peels/skins can be irritating; serve peeled', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (17, 13, '{"part": "skin"}', 'CAUTION', 'Peels/skins can be irritating; serve peeled', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (18, 24, '{"part": "skin"}', 'CAUTION', 'Peels/skins can be irritating; serve peeled', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (19, 13, '{"part": "core"}', 'CAUTION', 'Remove pineapple core; tough/fibrous', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
INSERT INTO public.rules VALUES (20, 21, '{"part": "pit"}', 'UNSAFE', 'Pit is a major choking/obstruction hazard; contains persin', '2025-11-07 18:28:41.499789-05', '2025-11-07 18:28:41.499789-05');
